import React from "react";
import { Link } from "react-router-dom";



function Sidebar(){
     return (
          <div id="sidebar">
               <ul>
                  <Link to="/">Home</Link>
                  <Link to="/verification">verification</Link>
                  <Link to="/renew">Renew</Link>
                  
               </ul>
          </div>
     )
}

export default Sidebar;
